            'sub': '대체로 말수가 많고 다른 사람의 일에 간섭을 많이 하여, 자신과 무관한 일에도 적극적으로 개입하려고 한다.\n다혈질적인 기운 강하고, 임기응변과 처세에 탁월하며 인정이 많아 남을 위하여 전심전력하기도 한다.\n정치적인 수완이 좋고 그러한 능력도 있다.\n상상력이 풍부하고 적절한 추진력도 갖추고 있으나, 잘난 체하고 교만하기 쉬우니 그러한 부분으로 협력과 화목을 스스로 깨는 경우가 있다.\n밖으로 향한 시선을 갖는 발산형의 에너지로 삶이 분주하며, 사교성이 좋으며 비교적 낮선 곳이나 낮선 이에게도 잘 다가가나, 자신이 주도적인 위치를 차지하고자 하는 성향이 있다.\n자신에 대한 애착이 강하기에 성숙하지 못하면 고집스럽고 편협하여 넓은 도량을 보여주지 못하나, 성숙하면 자신을 지속적으로 발전시키고 성정을 잘 닦으면 외유내강의 힘을 갖출 수 있다.\n어떠한 상황에도 적응력이 뛰어난 편이며, 따르는 이에게는 매우 좋은 리더가 될 수 있으며, 상황이 성숙되면 리더십을 발휘하고 솔선수범한다.\n특히 어려운 상황이나 위기상황에서 기지를 발휘하고 리더십을 발휘하는 잠재적인 힘이 있다.\n또한, 책임을 맡으면 책임감이 강하여 훌륭히 해내고자 하나, 누구의 지시를 받는 것을 기본적으로 싫어하며, 자신을 과시하려는 면으로 인하여 교만해지거나 다툼을 벌이는 일이 적지 않다 사회활동에도 관심이 많고 열정적이며, 넓은 사귐을 좋아하여 오는 사람을 막지 않고 가는 사람도 잡지 않는 타입이며, 타인에게 과시나 허영으로 베푸는 경우가 많아 지출이 과다하기 쉽다.\n항상 분주하고, 일이 없으면 오히려 몸이 아픈 스타일이나 분주한 만큼 과로에는 조심하여야 하며, 스트레스를 주의하고 꾸준히 활동을 하되 무리가 되지 않도록 하는 것이 필요하다.\n사람들과 협력하고 화목하길 원하고 유순해 보이나 고집이 세고, 즉흥적인 감각에 의존하여 섣불리 판단하고 무모하게 행동하는 경향이 있다.\n자신보다 세상의 안위를 걱정하는 큰 시각을 갖고 있는 편이다.'
