            'sub': '대체로 머리가 좋고 감각적인 면도 뛰어나서 예술적 감각도 뛰어나며 (기이한 면도 가지고 있음) 재주도 비상하고 대중의 인기를 얻을 수 있는 재능도 갖추고 있다.\n자유를 추구하며 방랑하기 쉽고 정착하지 못하며, 매사에 재빨리 대처하고, 독립적으로 행동하며 자신의 영역을 공고히 하고자 하고, 타인에게 지배되지 않고자 하는 독립성이 강함에도 불구하고 타인에 의존적인 경우가 많다.\n창의력은 있어 개혁하려는 의지는 있으나 이것저것에 관여하고 시작한 일에 맺음이 없기 쉬우며, 안정적이면 쉬이 태만하여 지고 성실함이 부족하여 실현하지 못하는 경우가 많을 수 있다.\n어떤 분야의 일을 맡겨도 잘 해내는 영특함이 있으며, 혼란스럽고 어려운 시기에도 침착성을 유지하고 일을 해결하여 내는 힘이 있다.\n이는 새로운 일에도 무모하다 싶게 도전하는 성향 때문이겠다.\n대체로 과묵한 편이며 도량이 넓어 보이는 면이 있으며, 독특한 자기 세계가 강하여 타인과 잘 어울리지 못하고 친화력이 부족하여 항상 외로운 처지에 빠지기 쉽다.\n자신의 영역이 확고하여 대인관계에 항상 실수와 화가 있을 수 있으며, 쉽게 사람들의 말에 미혹하기도 하고, 쉽게 사람들을 속이기도 하여 진정성을 담지 않고 관계를 유지하거나 일을 대하는 경우가 있다.\n직장에 잘 정착하지 못하고 이리 저리 옮겨 다니는 경우가 많겠으며 재주와 재간이 많으나 편협하게 자기 영역을 고집하는 경우에는 다툼과 시비가 끊이질 않고, 논쟁을 즐기는 성향으로, 괜한 시비 거리를 만들기도 한다.'
