            'sub': '다방면에 능통하며 기본적으로 좋은 에너지를 담고 있어 자신을 갈고 닦으면 능히 어느 분야든지 두각을 나타내고 크게 성취를 거둘 수 있겠으며, 특히, 언어 구사 능력이 뛰어나다.\n도덕적 이치나 도리에 밝고 마음의 지혜가 깊으며, 학식과 덕행이 높고, 학문과 기술을 습득하는 데에도 뛰어나며, 총명하고 슬기로움에 도리도 밝고 성품이 어질어서 많은 사람들에게 공경과 존중을 받는다.\n자신이 옳다는 생각이 강하여 비평이나 비판을 즐기며, 또한 지혜롭고 인의를 지키니 자신과 가정을 번영시키고, 세상에 이로운 일을 하니 윤택할 혜택을 누리고 칭송을 받을 만하다.\n활발하고 결실을 생성하는 에너지를 지니고 있으며, 풍채와 품격이 조용하고 차분하며 항상 서두름이 없이 당당하고 마음과 행동에 안정감이 있어 신뢰를 준다.\n성품이 어질어 많은 사람과 교류하나, 자신의 생각을 관철하고자 논쟁을 즐기는 탓에 오해를 받기도 하고 계산이 철저하여 인색하다는 인상을 주기도 한다.\n기본적으로 자신에 대한 애착이 강하고 이치와 도리에 밝으며, 그를 지키려 하며 올바른 인생관을 지니고 타인을 배려하는 품성도 지녀 폭넓게 많은 이들을 아우르고 존경 받겠다.\n어떠한 분야이건 능히 그 일을 해낼 수 있어 전 직종에 걸쳐 성공을 거둘 수 있겠으나, 많은 사람들의 인생행로에 올바른 방향을 제시하여 주는 역할을 맡으면 좋겠다.\n사람들과 협력하고 화목하길 원하고 유순해 보이나 고집이 세고, 즉흥적인 감각에 의존하여 섣불리 판단하고 무모하게 행동하는 경향이 있다.\n기본적으로 타인을 낮추어보고 무시하며 존중심을 갖지 못하는 경우가 많겠다.'
