            'sub': '활동적이고 활발하며 생기가 넘친다.\n자신을 희생하여서라도 의리와 신의를 지키며 넓은 마음과 기상을 지닌 경우가 많으며, 권위와 명예, 신의와 체면을 중요하게 여긴다.\n목적달성에 집중하고 의기가 충만하고, 희생과 의로움에 앞장서며, 성질이 급하나 의지가 굳세고 완강하여 자신의 주장을 내세울 때 극단적이기도 하다.\n무슨 일이든 의욕이 앞서는 것은 결과가 좋지 않을 수 있겠다.\n재능도 적지 않으나 무엇보다 도량이 넓고 기개가 있다고 할 수 있으며 항쟁심이 있어 잘 물러서지도 않으며 극단적인 상황에서는 난폭해지고 물리적으로 이를 처리하려고 한다.\n무인의 기질이 가득하고 활동적이며 배짱이 있다.\n그에 반하여 흉폭하고 고독함도 있으니 꾸밈없는 인간형을 잘 유지하면 좋겠다.\n방랑생활을 하는 이가 많으니 이러한 성향이라면 집안에 가두어 두려고 하지 마라.\n강직하고 굳세어 지구력과 정신력이 강하다.\n성격상 재해나 상해 수술과 같은 수가 많은 편이고, 남의 일에 간섭을 많이 하니 혈관계와 위장에 병이 생기기 쉬우니 잘 관리하라.\n배우자에게 가정 보다는 외부 활동 중심의 결혼 생활에 대한 이해를 구하는 것이 매우 중요하다.\n따라서 배우자의 도움이 있어야 안락한 가정생활이 가능하겠다.'
