            'sub': '품행이 단정하고 유난히 깔끔하며, 명예를 존중하고 그에 부합하게 행동하려 하며, 성실함과 착실함의 표본이라 할만하다.\n또한 슬기롭고 도리에 밝으며 눈과 귀가 밝아 주변을 잘 살피는 관찰력을 보유하고 있다.\n근본적으로 침착하며 강성이지만, 대부분 강함과 부드러움을 겸비하고 있어 편중됨이 없는 경우가 적으며, 신용을 지키니 신뢰를 얻으며 선행을 하는 도덕심이 있는 타입이다.\n그에 반하여 자존심이 강하며 변덕이 있고 때때로 신경질적인 반응을 보이기도 한다.\n불리한 입장이라고 판단이 되면 발뺌도 잘하며 임기응변의 꾀도 잘 낸다.\n지나치게 자신이 기준으로 타인에게 예민하게 대하는 경우가 적지 않으며, 자기 행동에 대하여 남에게 굽히지 않고 대항하기도 하나, 상황에 맞는 유연한 대처 능력도 가지고 있다.\n풍류와 재미를 즐기며 대체로 깔끔하고 외모도 수려한 편이어서 외적으로도 다른 사람들에게 좋은 인상을 주려하고 실제로 쉽게 호감을 사는 편이다.\n또한 인망이 있어 우군을 잘 만들어 낸다.\n평판을 중시하여 자신을 잘 관리 하고자 하며, 성실하고 선하게 행동하고 대인관계가 원만하고 평판이 좋다.\n정립되어진 상하관계나 체계적인 인간관계 틀을 유지하고 잘 관리하고 대인관계에 대하여 민감하고 처세를 잘한다.\n고위관료나 법률가를 포함하여 통수권자적 역할도 훌륭히 수행해 낼 수 있으며, 사업적으로도 훌륭히 역량을 발휘할 수 있다.\n주로 평온한 시기에 능력을 잘 발휘하나, 위기상황 시에도 탁월한 역량을 발휘한다.'
