            'sub': '활동적이고 활발하며 생기가 넘친다.\n자신을 희생하여서라도 의리와 신의를 지키며 넓은 마음과 기상을 지닌 경우가 많으며, 권위와 명예, 신의와 체면을 중요하게 여긴다.\n재능도 적지 않으나 무엇보다 도량이 넓고 기개가 있다고 할 수 있으며, 목적달성에 집중하고 의기가 충만하고, 희생과 의로움에 앞장서며, 성질이 급하나 의지가 굳세고 완강하여 자신의 주장을 내세울 때 극단적이기도 하다.\n항쟁심이 있어 잘 물러서지도 않으며 극단적인 상황에서는 난폭해지고 물리적으로 이를 처리하려고 한다.\n무인의 기질이 가득하고 활동적이며 배짱이 있다.\n그에 반하여 흉폭하고 고독함도 있으니, 꾸밈없는 인간형은 좋다.\n강직하고 굳세어 지구력과 정신력이 강하다.\n성격상 재해나 상해수술과 같은 수가 많은 편이고, 남의 일에 간섭을 많이 하며 방랑생활을 하는 이가 많으니 이러한 성향이라면 대외적으로 활동하는 편이 좋겠다.\n배우자에게 가정 보다는 외부 활동 중심의 결혼 생활에 대한 이해를 구하는 것이 매우 중요하다.\n따라서 배우자의 도움이 있어야 안락한 가정생활이 가능하겠다.\n비교적 성정과 인품이 좋은 경우가 많으며 겉으로는 온화해 보이지 않으나, 실제로는 속정이 많다.\n감정적으로 안정적이기 쉽지 않아 불안정하기 쉽고, 상황이나 사람을 쉽게 판단하고 얕보는 경향이 있다.\n명석한 두뇌는 매우 독창적이며 재능과 지혜가 좋고 특별한 재능을 보유하고 있기도 하다.\n또한 자신에게 의지하고 찾아오는 이는 성심을 다하여 돌보며, 자신에게 굴복하는 이에게도 철저하게 잘 해주는 편이다.'
