            'sub': '대체로 내성적이고 꼼꼼하며, 온화하고 순박하며 따뜻하다.\n예술적으로 소질이 있어 미학적인 것을 동경하고 즐긴다.\n기본적으로 참된 성품을 갖고 있으며 차분하면서도 낭만적인 감각이 있다.\n자신이 관심이 있는 부분에 몰두하여 최선을 다하는 성격이다.\n특정한 수준의 성취를 이루더라도 지속적으로 안정적인 환경을 유지할 만큼 성실하게 일을 하며 큰 저력을 가지고 있다.\n대인관계의 처신을 잘하는 편이나, 기본적으로 타인 (인간적인 관심)에게 관심이 많지 않다.\n그러나 예술적 취향이나 미학적 감각에 공감이 되는 사람들과는 깊은 관계를 맺는 경우가 많다.\n타인보다 우수하려고 하는 경쟁심과 우월감이 높아 타인에게 관심을 두기 보다는 자신의 일이나 관심에 매진하는 스타일이며, 또한 본성은 선량하고 품성이 좋아 사람들과 잘 지내고 인정받는 편이다.\n명석하고 예술적인 흥미도 높아 풍류를 즐기고, 이성을 사귐에 적극적이며 색정이 강하다.\n타인 보다 우월하다는 인식이 바탕에 깔려 있다.\n이는 열정과 집중력으로 자신의 우월성을 입증하는 편이라고 할 수 있다.\n상대방에게 호감을 주는 타입이나, 마음에 비교적 의심이 많고 상대방을 잘 믿는 편은 아니다.\n그러다 보니 타인에 대한 이해심 부족으로 보여 지는 경우가 많고 특히 배우자에 대하여는 더욱 의심을 하는 경우가 있다.'
