            'sub': '자신의 주장이 매우 강하며 쉽게 타협하지 않고 고집을 부리며, 자신의 일이 아니어도 이것저것에 관여를 많이 한다.\n타인에 대하여 자신의 의사에 맞거나 명분에 맞는 일을 하도록 종용하고 부추기기도 한다.\n기본적으로 인정이 있는 편이며, 타인을 돕고자 하는 마음도 있어 마음이 맞는 사람이면 물불을 가리지 않고 전심을 다하여 헌신하기도 한다.\n타인을 대하는데 상황이나 감정에 따라 대하는 것이 다르기 쉽겠다.\n정치적인 수완이 좋고 그러한 능력도 있으나, 욱하는 것은 주의하여야 한다.\n상상력이 풍부하고 적절한 추진력도 갖추고 있으나, 잘난 체하고 교만하기 쉬워 다 된 일에 코 빠뜨리는 수가 있다.\n대체로 사교성이 좋아 여러모로 분주하며 비교적 낮선 곳이나 낮선 이에게도 잘 다가가나, 그래도 자신이 주도적인 위치를 차지하여야 편안함을 느끼며 그리하고자 하는 성향이 있다.\n자신에 대한 애착이 강하기에 성숙하지 못하면 고집스럽고 편협하여 넓은 도량을 보여주지 못하나, 성숙하면 자신을 지속적으로 발전시키고 성정을 잘 닦으면 외유내강의 힘을 갖출 수 있다.\n그러기에 삶에 대한 공부를 하는 것이 좋다.\n어떠한 상황에도 적응력이 뛰어난 편이며, 따르는 이에게는 매우 좋은 리더가 될 수 있으며 상황이 성숙되면 리더십을 발휘하고 솔선수범한다.\n특히 어려운 상황이나 위기상황에서 기지를 발휘한다.\n사회활동에도 관심이 많고 열정적이며, 넓은 사귐을 좋아하여 오는 사람을 막지 않고 가는 사람도 잡지 않는 타입이며, 타인에게 과시나 허영으로 베푸는 경우가 많아 지출이 과다하기 쉽다.\n무엇이건 계속적으로 추구하고 노력하라.\n일이면 일을, 아니면 무언가 집중할 수 있는 취미라도 갖도록 하라.\n그냥 가만히 있는 스타일이 아니며 그런 것이 좋지도 않다.'
