            'main': '대체로 성실하면서 자비심이 있으며, 인정을 많이 베풀고자 하는 마음을 가지고 있다.\n자기에 대한 높은 인식이 있어 보이지 않게 잘난 체 하는 면이 있으며, 자신이 제일이라는 우월감을 갖고 살아가는 타입이다.\n기본적으로 법규에 순응하며 예법에 따라 조심성 있게 행동하고 사고의 치우침이 없는 지라 떳떳하고 당당한 성품을 갖추는 경우가 많다.\n그러므로 쉽게 남에게 굽히지 않고 대항하거나 민감하게 구는 경우도 있다.\n전체적으로, 정신적으로나 육체적으로 품격이잘 갖추어져 있어, 생활이 안정되고 삶의 보람을 느끼는 인생을 영위하는 경우가 많다.\n체면과 명예를 귀하게 여겨 자칫 과하게 자신을 포장하거나 드러내는 경우가 있다.\n인격과 품위가 있고 자비와 도덕심을 갖추었고 매사에 세심하게 살피고 원칙과 신념으로 책임감 있는 행동을 한다.\n권위와 통솔력이 있으며 명예와 질서를 존중하고 바른 생활을 한다.\n도덕과 질서 법률을 관장하는 법칙을 순응하고 개혁과 변화를 싫어하며 보수적인 경향의 소유자이다.\n가정이나 단체, 국가, 인류사회의 질서를 관장하며, 집안에서는 자상하면서도 엄한 가장이다.\n선천적으로 명랑하고 대범한 인품이며 금전적인 실속보다는 명예를 취한다.\n모든 일은 계획을 세워서 실행하는 타입이나 실행력이 다소 부족한편이며, 공적인 일에 두각을 나타내며 뛰어난 관리와 경영능력으로 실업가가 많다.',
            'sub': '품행이 단정하고 유난히 깔끔하며, 명예를 존중하고 그에 부합하게 행동하려 하며, 성실함과 착실함의 표본이라 할 만하다.\n또한 슬기롭고 도리에 밝으며 눈과 귀가 밝아 주변을 잘 살피는 관찰력을 보유하고 있다.\n강함과 부드러움을 겸비하고 있어 편중됨이 없는 경우가 적으며, 신용을 지키니 신뢰를 얻으며 선행을 하는 도덕심이 있다.\n그에 반하여 자존심이 강하며 변덕이 있고, 때때로 신경질적인 반응을 보이기도 한다.\n지나치게 자신이 기준으로 타인에게 예민하게 대하는 경우가 적지 않으며, 상황에 맞는 유연한 대처 능력도 가지고 있다.\n그러나 불리한 입장이라고 판단이 되면 발뺌도 잘하며 임기응변의 꾀를 잘 낸다.\n평판을 중시하여 자신을 잘 관리 하고자 하며, 성실하고 선하게 행동하고, 풍류와 재미를 즐기며 대체로 깔끔하고 외모도 수려한 편이어서 외적으로도 다른 사람들에게 좋은 인상을 주려하고 실제로 쉽게 호감을 사는 편이다.\n대인관계가 원만하니 평판이 좋고 인망이 있어 우군을 잘 만들어 낸다.\n또한, 정립되어진 상하관계나 체계적인 인간관계 틀을 유지하고 잘 관리하고 대인관계에 대하여 민감하고 처세술이 좋다.\n고위관료나 법률가를 포함하여 통수권자적 역할도 훌륭히 수행해 낼 수 있으며.\n사업적으로도 훌륭히 역량을 발휘할 수 있다.\n주로 평온한 시기에 능력을 잘 발휘하나, 위기상황 시에도 탁월한 역량을 발휘한다.'
