            'sub': '명석한 두뇌와 독특한 감각이 긍정적인 연구심과 어울리면, 탐구하고 이론화 하는 체계적인 면에 높은 성취를 거둘 수 있다.\n예술적 기질이 풍부하며 기술적이고 독창적인 영역에 특별한 재능을 보유한 경우가 많다.\n기본적으로 머리가 좋고 감각도 뛰어나며 재치가 충만하고, 자존심이 무척 강하다.\n독특한 시각과 의견을 가지고 있어 타인의 의견을 수용하지 않고 비판하고자 하는 면이 강하고 비타협적이어서 온화해 보이지 않는다.\n자신의 뜻을 이루지 못하거나 방해되면 안정되지 못하고 불안감이 많으며, 홀로 떨어져 고독하게 지내기 쉽고, 자신에게 거스르는 것을 참지 못하고 난폭해지기 쉽다.\n자신을 과소평가하고 쟁론사가 많으며, 그렇다고 타인을 존중하는 것도 아니다.\n자신의 명석함으로 성숙함이 더하여지지 않으면, 상황이나 사람을 쉽게 판단하고 깔보는 성향이 있어 사회생활에서 오해와 비방을 불러 온다.\n인덕이 없으며 만족함이 없어 항상 부족함을 느낀다.\n자신의 뜻과 기질을 발휘하기 위하여 과격해지기도 한다.\n다만, 자신에게 의지하고 찾아오는 이는 성심을 다하여 돌보며, 자신에게 굴복하는 이에게는 잘 해주는 편이다.\n자기중심적이고 타인에 대한 너그러운 마음이 없고 반하므로 사회적 활동과 대인관계에 갈등과 다툼이 많다.\n순간의 감정을 억누르지 못하여 다툼이 많고, 한 조직에 오래 머물지 못하고 이리저리 떠돈다.\n매우 주관적인 입장에서 타인을 대하므로 자신에게 의지하고 찾아오는 이는 성심을 다하여 돌보며, 사람에 대한 이해 (자신과 타인 모두)가 부족하여, 대인관계가 원만하지 못하고 항상 고립되기 일쑤다.'
