            'sub': '기본적으로 분주하고 선량하고 착하며 다툼을 싫어하고 둥글둥글한 성격으로 악의가 없고 다른 사람들과 잘 어울린다.\n의리가 있고 진솔하며, 동정심이 많아 사람들을 따뜻하게 대한다.\n다른 사람의 마음을 잘 읽는 편이고 설득력도 좋고, 상황에 대한 판단도 좋아서 상황에 맞게 처신을 잘 한다.\n남의 비위를 잘 맞추면서도 나름대로 본인의 실리를 얻는 편이다.\n활동성이 좋으며 대체로 언변이 좋아 자신의 의지를 잘 설명하고 타인을 잘 설득하는 편이다.\n복잡함을 싫어하고, 단순한 것을 좋아한다.\n타인을 허물없이 사실적으로 대하며, 어려운 사람에게 베풀기를 좋아하는 성격이다.\n낯선 사람들과도 잘 어울리며 적응도 잘한다.\n또한 사실을 보다 과하게 나타내어 보이는 경우가 있으며 대체로 큰 비전을 제시하는 성향과 능력이 있다.\n또한 언변이 없더라도 다른 사람들과 쉽게 친숙하게 다가서는 편이다.\n적극적이며 집착이 강하고, 사안마다 실속을 잘 차리며 적절히 환경을 이용할 줄 아는 재주도 있고 여러모로 수완이 좋아 크게 사업을 일으킬 기운과 능력을 가지고 있으나 투기성이 높은 편이다.\n사업가로서의 기질이 충만하고, 자신의 실리를 챙기면서도 타인 나아가 사회나 국가를 위해 헌신하고자 하는 마음도 가지고 있어 사업수완을 기반으로 정치적인 성과도 거둘 수 있겠다.'
