            'sub': '성실하고 아껴서 관리하니 경제적으로도 어렵지 않겠다.\n운수재복한데 근검절약을 더하니 갈수록 더 좋은 삶이다.\n아울러 총명하고 지혜로우며 온화하고 후덕하여 사람들을 돕기를 좋아한다.\n대인관계에서 타인의 의견과 개성을 존중하며 비교적 언변과 기억력도 좋으며 도리에 어긋나지 않고 거짓과 꾸밈이 없는 편이고 상황을 판단하는 분별력이 있어 많은 사람들에게 받는 편이다.\n기본적으로 보수적인 성향이며 자신의 이익을 우선에 두는 경향이 짙다.\n타인을 존중하다가도 때로는 타인의 의견을 들으려 하지 않는다.\n자신에게 손해를 끼치는 사람과는 절교하는 냉정함도 있다.\n다방면에 상당한 실력을 발휘하며 일이 성과가 날 때까지 집중한다.\n한 단계 한 단계 자신의 노력으로 이루어 나가야 하며 실제로 그러한 성과를 거두는 이가 많다.\n또한 성실하게 주어진 일에 매진하면 좋은 결실이 많겠다.\n타인을 존중하고 수용하는 편이고 타인이 잘못에 대하여도 이해하고 감싸주는 면이 있다.\n분별력과 이해심이 깊고 타인을 다루는 처세술도 뛰어난 편이다.\n그러므로 무언가를 하면 대부분 성과를 거두는 타입이겠다.\n타인을 살피는 눈과, 다툼을 유연하게 피하여 평판이 좋으며, 언변도 좋아서 설득력이 있으며, 자신의 의견을 굳게 내세우면서도 남과 다투지 않고 조절할 줄 안다.\n또한 다소 느리고 답답함은 있으나 실수가 비교적 적은 편이다.'
